                         end\
                     elseif event == \"UNIT_SPELLCAST_START\" then\
                         local _, castGUID, spellID = ...\
                         \
                         if not castGUID then return end\
                         \
                         if spellID == 467606 then -- Sound Cannon\
                             for _, state in pairs(allstates) do\
                                 state.show = false\
                                 state.changed = true\
                             end\
                             \
                             aura_env.castStart = GetTime()\
